import React, { useState } from "react";
import LikeService from "../services/like.service";

const RatePost = () => {
    const handleLike = (e) => {
        e.preventDefault();
        LikeService.ratePost();
    };
    return (
        <div className="submit-form">
            <span onClick={handleLike}>like</span>
        </div>
    );
};
export default RatePost;
